    data: |
      SELECT DISTINCT * FROM tab0 (FORMAT parquet) WHERE NOT ( col2 + - 98 + + col0 * - col1 ) BETWEEN + 68 / + col0 AND col1 * CAST ( NULL AS INTEGER );
  - name: tab0

outputs:
  - name: q5670.out
    data: |
      15	81	47
      87	21	10
      97	1	99
